import React from "react";

class DisplayInfor extends React.Component {
  render() {
    const { name, age } = this.props;
    console.log(this.props);
    return (
      <div>
        <div>My name is {name}</div>
        <div>I'm 20 years {age}</div>
      </div>
    );
  }
}

export default DisplayInfor;
